import React from 'react';
import styled from 'styled-components';

const Logo = styled.div``;
const Container = styled.div`
  margin: 0 0 0 250px;
`;

const TopHead = () => {
  return (
    <Container>
      <Logo>
        <img src="../static/logo.png" alt="logo" width="50px" height="50px" />
      </Logo>
    </Container>
  );
};

export default TopHead;
